import React from "react";

const AppSidebar = () => {
  return (
    <section className="App-sidebar">
      <header className="App-sidebar__header">
        <h2>Our Tours</h2>
      </header>
      <section className="App-sidebar__intro">
        <h3>Explore California</h3>
        <p>
          What type of California experience do you want to have? Are you
          looking for an exciting adventure? A chance to relax and get away from
          it all? Or maybe you're looking for a chance to do something entirely
          new and enriching! As you can see, we've got you covered. We offer
          tours that are as diverse as California itself! Select any of our
          tours learn more about pricing and available options.
        </p>
      </section>
    </section>
  );
};

export default AppSidebar;
